(function(){$("#telefones").tagsinput("items");$("#cep").inputmask({mask:["99999-999"],keepStatic:true});$("#cpf").inputmask({mask:["999.999.999-99"],keepStatic:true});$('input[name="cep"]').blur(function(a){let cep=$('input[name="cep"]').val()||"";if(!cep){return}let url="http://viacep.com.br/ws/"+cep+"/json";$.getJSON(url,function(b){if("error" in b){return}$('input[name="endereco"]').val(b.logradouro);$('input[name="bairro"]').val(b.bairro);$('input[name="cidade"]').val(b.localidade);$('input[name="uf"]').val(b.uf);$('input[name="complemento"]').val(b.complemento)})})})();